/**
 * Create a new TurkishLowerCaseFilter, that normalizes Turkish token text 
 * to lower case.
 * 
 * @param in TokenStream to filter
 */
public TurkishLowerCaseFilter(TokenStream in) {
  super(in);
  termAtt = addAttribute(TermAttribute.class);
}

